import React, { useState } from 'react'
import CalendarEntry from 'components/CalendarEntry'

const App = () => {
  const [calendarEntries, setCalendarEntries] = useState([])

  return (
    <div >
      <h1>Calendar</h1>
      {calendarEntries.map(c =>
        <CalendarEntry date={c.date} content={c.content}/>
        )}
    </div>
  );
}

export default App
